import React from 'react';
import Header from './Header';
import Footer from './Footer';
import './HomePage.css'; // Importing the CSS file

const HomePage = () => {
  return (
    <div>
      <Header />
      <main>
        <h2>Welcome to the Client Management System</h2>
        <p>This system allows you to manage your clients efficiently.</p>
        <p>To get started, click on the "Login" button in the header.</p>
      </main>
      <Footer />
    </div>
  );
};

export default HomePage;
